/*!40000 ALTER TABLE `lessons` DISABLE KEYS */;
INSERT INTO `lessons` VALUES (1,1,1,'你正在設計一款點餐系統，當顧客下單後，系統需要顯示一段訊息，例如：「你點了:漢堡」\r\n','認識 print() 函數，並了解它可以在螢幕上「顯示訊息」。它的作用就是把括號中的內容（文字或數字），顯示給使用者看。','這段程式碼執行後，畫面會出現什麼？','print(\"你點了:漢堡\")','print(\"你點了:漢堡\")','你點了:漢堡','\"你點了:漢堡\"','無法執行,會出錯','B','A：只是把程式碼又寫一次，不是執行結果。\r\nB：正確！print() 會輸出括號裡的文字內容。\r\nC：螢幕不會顯示引號，只有文字本身。\r\nD：這行程式正確，不會出錯。','2025-07-31 02:13:35','https://raw.githubusercontent.com/YeChenHua/bot-images/main/images/Q1-1.png','AgACAgQAAxkDAAIa9WjFGkVOJQrKTO6-1QWPRJbT4UCqAAIPuzEbVqUlUdWGHpWf4hFlAQADAgADeQADNgQ'),(2,1,2,'現在顧客想要自己輸入要點的東西，例如輸入「薯條」，那系統就要顯示：「你點了:薯條」','學會使用 input() 函數，讓使用者輸入資料。它的作用是，請使用者輸入資料，並把輸入的內容存到變數裡。','如果使用者輸入任一食物名稱（例如薯條），程式最後會顯示什麼樣的訊息？','item = input(\"請輸入品項:\")\r\nprint(\"你點了:\" + item)','顯示使用者輸入的文字','顯示「你點了:」','顯示「你點了:」再加上使用者輸入的文字','出錯，無法執行','C','A：input() 會把輸入存進 item，但 print() 是「你點了:」 + item，所以不會只顯示輸入內容。\r\nB：輸出時一定會包含使用者輸入的部分。\r\nC：正確！如果輸入「薯條」，最後結果就是「你點了:薯條」。任何輸入內容都會被接在「你點了:」後面。\r\nD：這段程式語法正確，可以正常執行。','2025-07-31 02:13:35','https://raw.githubusercontent.com/YeChenHua/bot-images/main/images/Q1-2.png','AgACAgQAAxkDAAIZWmjD10JI4mxs0W86MbFtc593N61QAAJHujEbSHMtUQW-P84xs28hAQADAgADeQADNgQ'),(3,1,3,'前面我們學會了用 print() 顯示訊息，也能搭配 input() 取得使用者輸入。但是如果想要讓顯示更專業，例如：「你點了：雞塊，一份」','認識並學會使用 f-string（格式化輸出），讓變數能夠自然地插入到句子中。','執行後，輸出會是？','item = \"雞塊\"\r\namount = 1\r\nprint(f\"你點了：{item}，{amount}份\")','你點了：item，amount份','你點了：雞塊，1份','f\"你點了：雞塊，1份\"','{item}，{amount}','B','A：這是單純的文字，沒有把變數值代入。\r\nB：正確！f-string 會自動把 item 和 amount 的值插入字串中，所以結果是「你點了：雞塊，1份」。\r\nC：這只是一個字串的樣子，不是執行結果。\r\nD：這是變數的寫法，不會直接顯示在輸出中。','2025-07-31 02:13:35','https://raw.githubusercontent.com/YeChenHua/bot-images/main/images/Q1-3.png','AgACAgQAAxkDAAIZaWjD12c7UohIUR6DSGa-ORa2twq9AAIbuzEbcBckUdrMcInFCY70AQADAgADeQADNgQ'),(4,2,1,'你參加了一場測驗，滿分 100 分，及格分數為 75 分。現在要用程式來判斷分數是否通過。','理解 if 條件判斷的基本邏輯，並知道多個 if 是「獨立判斷」而不是互斥。','執行以下程式碼後，會輸出什麼？','score = 75\r\npass_score = 75\r\n\r\nif score >= pass_score:\r\n    print(\"通過\")\r\nif score == pass_score:\r\n    print(\"剛好及格\")\r\n','通過','通過\r\n剛好及格','剛好及格','沒有任何輸出','B','A：不正確，因為 score >= pass_score 成立，但同時 score == pass_score 也成立，兩行都會執行。\r\nB：正確。兩個 if 獨立判斷，兩個條件同時成立時，會輸出兩行。\r\nC：錯誤。忽略了第一個條件，其實也會成立。\r\nD：錯誤。程式碼確實會輸出，因為條件都成立。','2025-08-18 15:57:21','https://raw.githubusercontent.com/YeChenHua/bot-images/main/images/Q2-1.png','AgACAgQAAxkDAAIb0mjFPxjGH99H_p8wR_gbOSCZJblRAAIMujEbP9VUUSEUdRHRTpfRAQADAgADeQADNgQ'),(5,2,2,'想像你正在參加一次運動會，你需要根據自己的體能狀況來決定是否參加比賽。','理解如何使用 if 和 else 來處理條件判斷。','請撰寫一段 Python 程式碼來判斷你的參賽資格：','level = \"中等\"\r\n\r\n# 請完善以下條件判斷\r\nif level == \"好\" or level == \"中等\":\r\n    print(\"可以輕鬆參加所有比賽！\")\r\nelse:\r\n    print(\"建議多加訓練！\")','可以輕鬆參加所有比賽！','可以參加部分比賽！','建議多加訓練！','不確定參賽資格。','A','A：正確，因為 level 為 \"中等\"，程式設計將其包含在「可以輕鬆參加所有比賽！」的條件中。\r\nB：不正確，選項內容未被輸出。\r\nC：不正確，條件不符合。\r\nD：不正確，程式有明確判斷。','2025-08-18 16:00:24','https://raw.githubusercontent.com/YeChenHua/bot-images/main/images/Q2-2.png','AgACAgQAAxkDAAIb12jFPy7NcucqnbfL84PguQvc7qF-AAL9uTEb7FJUUTjmjhKgMJEpAQADAgADeQADNgQ'),(6,2,3,'想像你要選擇一部電影觀看。根據電影的評分，你需要決定是否要看這部電影。','理解如何使用 if、elif 和 else 來處理多個條件。','請觀察一段 Python 程式碼，根據電影評分輸出是否觀看：','movie_rating = 8\r\n\r\n# 請完善以下條件判斷\r\nif movie_rating >= 7:\r\n    print(\"值得一看！\")\r\nelif movie_rating >= 5:\r\n    print(\"普普通通~\")\r\nelse:\r\n    print(\"可以考慮其他電影。\")','值得一看！','可以考慮其他電影。','無法判斷。','普普通通~','A','A：正確，因為符合條件。\r\nB：不正確，因為不會進入 else 區塊。\r\nC：不正確，程式中有明確的判斷。\r\nD：不正確，因為評分為 8，大於 7。','2025-08-18 16:03:25','https://raw.githubusercontent.com/YeChenHua/bot-images/main/images/Q2-3.png','AgACAgQAAxkDAAIb3GjFP0XBJN4fYDWT3BRdUAM65SalAAIbujEbwINVUbSsuo-dH6zOAQADAgADeQADNgQ'),(7,3,1,'假設你在校園內組織了一場募款活動，每位捐贈者都會提供一些金額。你需要計算所有捐贈者的總捐款額。','使用 for 迴圈來計算輸入的數字總和。','你設計了一段程式碼，請使用者輸入 5 位捐贈者的金額並加總。假設使用者依序輸入：100、200、150、50、300。程式如下：','total = 0\r\nfor i in range(5):\r\n    amount = int(input(f\"請輸入第 {i + 1} 位捐贈者的金額：\"))\r\n    total += amount\r\nprint(f\"總捐贈金額是：{total}\")','總捐贈金額是：700','總捐贈金額是：750','總捐贈金額是：800','總捐贈金額是：900','C','加總：100 + 200 + 150 + 50 + 300 = 800，使用迴圈重複輸入並累加，最後輸出總金額','2025-08-27 19:02:30','https://raw.githubusercontent.com/YeChenHua/bot-images/main/images/Q3-1.png','AgACAgQAAxkDAAIq4GjNq0a2YFbxguAMggfwXG80n8pMAAJFujEbptN8UbDQgZhQN7xSAQADAgADeQADNgQ'),(8,3,2,'假設你參加了一個數學遊戲，遊戲中要求你找到 0 到 20 之間的所有偶數，然後計算這些偶數的總和。','使用 for 迴圈和 if 條件判斷來過濾特定的數字。','利用 for 迴圈計算從 0 到 20 中的所有偶數的總和。','total = 0\r\nfor i in range(21):\r\n    if i % 2 == 0:\r\n        total += i\r\nprint(total)','100','90','20','110','D','從 0 到 20 的偶數有0, 2, 4, ..., 20\r\n這些數字加起來的總和是 110','2025-08-27 19:35:36','https://raw.githubusercontent.com/YeChenHua/bot-images/main/images/Q3-2.png','AgACAgQAAxkDAAIrpGjRakhlVI_pTeE02HJ6RY-BpOvVAAL7uTEbcTiNUa3zP03_uIsiAQADAgADeQADNgQ'),(9,3,3,'假設舉辦一場健身挑戰賽，參賽者可以不斷輸入自己的運動時間。為了統計參賽者總共運動了多少時間，你需要讓參賽者持續輸入運動時間，直到他們輸入「0」來結束。','while 迴圈讓你可以重複執行一段程式碼，直到特定的條件不再成立。','小明參加健身挑戰賽，第一天運動 2 小時，第二天 3 小時，第三天輸入 0 表示挑戰結束。請問系統會輸出什麼？','total = 0\r\nwhile True:\r\n    time = int(input(\"請輸入運動時間（小時），若要結束請輸入 0：\"))\r\n    if time == 0:\r\n        break\r\n    total += time\r\nprint(f\"{total}小時\")','0小時','2小時','5小時','程式錯誤，無法執行','C','第一次輸入 2 → total = 2\r\n第二次輸入 3 → total = 5\r\n第三次輸入 0 → 跳出迴圈\r\n最終輸出：總運動時間是：5小時','2025-08-27 21:23:13','https://raw.githubusercontent.com/YeChenHua/bot-images/main/images/Q3-3.png','AgACAgQAAxkDAAItXWjSnwptVZgnVw-L6E87HY9bAAGqMAACtboxG6LjlFHiO24jeVhpLAEAAwIAA3kAAzYE'),(10,5,1,'你正在幫一位老師整理班級的學生名單。老師要求你只記錄姓氏為「陳」的學生。','學會如何利用條件判斷篩選資料，只將符合條件的項目加入串列。','如果使用者依序輸入以下內容：陳大明、王小華、陳美麗、結束。請問最終 students 串列的內容是什麼？','students = []\r\nwhile True:\r\n    name = input(\"請輸入學生姓名：\")\r\n    if name == \"結束\":\r\n        break\r\n    if name.startswith(\"陳\"):\r\n        students.append(name)\r\nprint(\"符合條件的學生名單：\", students)','[\'陳大明\', \'王小華\', \'陳美麗\']','[\'陳大明\', \'陳美麗\']','[\'陳大明\', \'王小華\', \'陳美麗\', \'結束\']','[ ]','B','程式碼利用 if 判斷式篩選出以「陳」開頭的姓名，只將符合條件的資料加入串列，所以 王小華 不會被包含在內。','2025-08-28 14:52:48','https://raw.githubusercontent.com/YeChenHua/bot-images/main/images/Q4-1.png','AgACAgUAAxkBAAE6bE9otUcE_eWOUK_BUWJgZ17hU6D-xwACEccxG1x8kVVCfeKcDLpb_QEAAwIAA3kAAzYE'),(11,5,2,'你正在開發一個圖書館的書籍查詢系統。使用者可以輸入書名，你的程式需要判斷這本書是否在圖書館的庫存清單中。','學會如何使用 in 運算子在串列中快速尋找特定資料。','如果使用者輸入 人工智慧，程式碼最終會印出什麼結果？','books = [\"Python入門\", \"資料科學\", \"網頁設計\", \"人工智慧\"]\r\nsearch = input(\"請輸入要查詢的書名：\")\r\nfound = False\r\n\r\nfor book in books:\r\n    if book == search:\r\n        found = True\r\n\r\nif found:\r\n    print(f\"恭喜！\'{search}\' 找到了。\")\r\nelse:\r\n    print(f\"抱歉，\'{search}\' 不在清單中。\")','人工智慧','抱歉，\'人工智慧\' 不在清單中。','Python入門, 資料科學, 網頁設計, 人工智慧','恭喜！\'人工智慧\' 找到了。','D','for 迴圈會逐一檢查串列中的每本書。當找到與使用者輸入相符的「人工智慧」時，found 變數會被設為 True，因此最終會印出「恭喜」的訊息。','2025-08-28 15:09:35','https://raw.githubusercontent.com/YeChenHua/bot-images/main/images/Q4-2.png','AgACAgUAAxkBAAE6bFNotUccIRcKS6u-VO9I9Rtj5PhvlwACEMcxG1x8kVWAIsyE6wekSAEAAwIAA3kAAzYE'),(12,5,3,'你正在幫餐廳計算今天的顧客點餐總金額。每一筆輸入都是一個餐點的價格，你需要計算出總收入，並算出每個餐點的平均價格。','學會如何將使用者輸入的資料轉換為數字，並利用內建函式對串列中的資料進行計算。','如果使用者依序輸入以下價格：50、75、100、end。請問程式碼最終會印出什麼結果？','money = []\r\nwhile True:\r\n    price = input(\"請輸入餐點價格（或輸入 \'end\' 結束）：\")\r\n    if price == \"end\":\r\n        break\r\n    money.append(int(price))\r\n\r\ntotal = sum(money)\r\naverage = total / len(money)\r\n\r\nprint(f\"總收入：{total} 元\")\r\nprint(f\"平均價格：{average} 元\")','總收入：225 元 / 平均價格：75.0 元','總收入：225 元 / 平均價格：75 元','總收入：225 元 / 平均價格：25.0 元','總收入：50 元 / 平均價格：50.0 元','A','程式將輸入的字串價格轉換為數字，並使用 sum() 函式計算總和 225，再用 len() 函式計算項目數 3。最終，總和除以項目數得到平均值 75.0。','2025-08-28 15:10:55','https://raw.githubusercontent.com/YeChenHua/bot-images/main/images/Q4-3.png','AgACAgUAAxkBAAE6VclosfZ9IF2EvC_ci1Cy7QSGLBiHkQACFskxG_NgkFXHUtuCLzUqdgEAAwIAA3kAAzYE'),(13,6,1,'現在正在規劃一場音樂節，你需要記錄每位表演者的資訊，例如姓名、樂器以及演出時間。','理解如何使用鍵（key）來從字典（dictionary）中取得對應的值（value）。','請創建一個字典，該字典包含以下資訊：小明表演吉他，小華表演鋼琴，小紅表演鼓。然後在程式中印出小華的資訊。','performers = {\'小明\': \'吉他\',\'小華\': \'鋼琴\', \'小紅\': \'鼓\'}\r\n\r\nprint(performers[\'小華\'])','吉他','小明','鼓','鋼琴','D','使用 [] 符號從字典取值','2025-09-01 20:19:18','https://raw.githubusercontent.com/YeChenHua/bot-images/main/images/Q5-1.png','AgACAgUAAxkBAAE6eDJotrczxHrZBgLA1TNynUk-MfDPkgACLcQxGzoMuVUD7KCK8Pb14QEAAwIAA3kAAzYE'),(14,6,2,'你是一名活動統計員，負責記錄一場大型美食市集的銷售數據。每當一個攤販賣出一項商品，你就會收到一筆記錄。你的任務是計算每種商品總共賣出了多少件。','學習如何使用字典來進行計數統計。','假設你有一份空的銷售字典 sales。請觀察下面的 Python 程式碼，並判斷在處理完所有的銷售記錄後，最終 sales 字典的內容是什麼？','sales = {}\r\nrecords = [\"雞蛋糕\", \"珍珠奶茶\", \"雞蛋糕\", \"雞蛋糕\", \"蚵仔煎\", \"珍珠奶茶\"]\r\n\r\nfor i in records:\r\n    sales[i] = sales.get(i, 0) + 1\r\n\r\nprint(sales)','{\'雞蛋糕\': 3, \'珍珠奶茶\': 2, \'蚵仔煎\': 1}','{\'雞蛋糕\': 1, \'珍珠奶茶\': 1, \'蚵仔煎\': 1}','{\'雞蛋糕\': 3, \'珍珠奶茶\': 1, \'蚵仔煎\': 1}','{\'雞蛋糕\': 4, \'珍珠奶茶\': 2, \'蚵仔煎\': 1}','A','for 迴圈會逐一處理每個商品。sales.get(i, 0) 會檢查該商品是否已在字典中：若不在，則從 0 開始加 1；若已在，則取得現有數值再加 1，從而正確累計每個商品的總銷售量。','2025-09-01 20:52:21','https://raw.githubusercontent.com/YeChenHua/bot-images/main/images/Q5-2.png','AgACAgUAAxkBAAE6eDRotrdIXgkPFag9xODfeDNBe_q4oAACLsQxGzoMuVUgG9w4-qFbaAEAAwIAA3kAAzYE'),(15,6,3,'小華正在寫一個程式來記錄他最喜歡的幾本程式設計書籍，他想要將書名和作者配對起來。','字典是 Python 中的一種資料結構，它能夠將鍵（key）與值（value）配對，從而高效地儲存和存取資料。','請判斷當程式執行以下程式碼，並依序輸入「Python程式設計、陳明」、「資料結構、李華」時，程式執行後，會輸出什麼？','books = {}\r\ncount = 2\r\n\r\nfor i in range(count):\r\n    title = input(\"請輸入書名：\")\r\n    author = input(\"請輸入作者：\")\r\n    books[title] = author\r\n\r\nprint(books)','{\'Python程式設計\': \'陳明\', \'資料結構\': \'李華\'}','[\'Python程式設計\', \'陳明\', \'資料結構\', \'李華\']','{\'資料結構\': \'李華\'}','{\'Python程式設計\': \'陳明\'}','A','由於迴圈執行兩次，程式會依序將兩組輸入的書名和作者，以 key（書名）和 value（作者）的形式新增到 books 字典中。','2025-09-01 21:00:46','https://raw.githubusercontent.com/YeChenHua/bot-images/main/images/Q5-3.png','AgACAgUAAxkBAAE6eDZotrdeCTJ6R7bBC7F1osKmvselvQACL8QxGzoMuVXj-U1JmziuTgEAAwIAA3kAAzYE'),(16,4,1,'你正在開發一個簡單的金融應用程式，需要一個功能來快速判斷每一筆交易的金額是收入（正數）還是支出（負數）。','學習如何使用函式封裝多重條件判斷，並根據輸入值回傳不同的字串。','寫一個函式來判斷輸入數字是正數、負數還是零。','def check(number):\r\n    if number > 0:\r\n        return \"正數\"\r\n    elif number < 0:\r\n        return \"負數\"\r\n    else:\r\n        return \"零\"\r\n\r\nr1 = check(15)\r\nr2 = check(-5)\r\nr3 = check(0)\r\n\r\nprint(f\"15 是：{r1}\")\r\nprint(f\"-5 是：{r2}\")\r\nprint(f\"0 是：{r3}\")','15 是：正數\r\n-5 是：負數\r\n0 是：零','15 是：正數\r\n-5 是：正數\r\n0 是：零','15 是：負數\r\n-5 是：負數\r\n0 是：零','15 是：正數','A','函式會根據輸入值 15、-5 和 0 依序回傳「正數」、「負數」和「零」，最終印出各自的結果。','2025-09-02 17:44:11','https://raw.githubusercontent.com/YeChenHua/bot-images/main/images/Q6-1.png','AgACAgQAAxkDAAIx22jXv_arL-1xJf0udTL-faKApUETAALxuTEbwQ3FUnLzU1tKSc9mAQADAgADdwADNgQ'),(17,4,2,'你正在為一個遊戲設計一個擲骰子功能。你希望如果擲出的點數是偶數，玩家就能得到額外的獎勵。','學習如何將模數運算 (%) 應用於函式，並回傳布林值來表示條件判斷的結果。','寫一個函式，判斷一個數字是否為偶數並回傳布林值。','def is_even(number):\r\n    if number % 2 == 0:\r\n        return True\r\n    else:\r\n        return False\r\n\r\nresult = is_even(10)\r\nprint(f\"10 是偶數嗎？ {result}\")\r\n\r\nresult = is_even(7)\r\nprint(f\"7 是偶數嗎？ {result}\")','10 是偶數嗎？ False \\n 7 是偶數嗎？ True','10 是偶數嗎？ True \\n 7 是偶數嗎？ False','10 是偶數嗎？ True \\n 7 是偶數嗎？ True','10 是偶數嗎？ False \\n 7 是偶數嗎？ False','B','函式判斷 10 除以 2 的餘數為 0，回傳 True；判斷 7 除以 2 的餘數不為 0，回傳 False。','2025-09-02 17:45:43','https://raw.githubusercontent.com/YeChenHua/bot-images/main/images/Q6-2.png','AgACAgUAAxkBAAE6ecVottkPM-4MD-5WgmXZ6VF2T77tAwACasUxGywmuFWoSE0jis8gMgEAAwIAA3kAAzYE'),(18,4,3,'你正在開發一個線上購票系統，需要根據客戶的年齡來判斷他們應該購買哪種票價。如果年齡在 12 歲以下是兒童票，12 到 65 歲是成人票，65 歲以上則是敬老票。','學習如何使用 if...elif...else 結構，在函式中處理多個互斥的範圍條件。','寫一個函式，根據年齡判斷應購買的票種。','def ticket(age):\r\n    if age < 12:\r\n        return \"兒童票\"\r\n    elif age <= 65:\r\n        return \"成人票\"\r\n    else:\r\n        return \"敬老票\"\r\n\r\ntype1 = ticket(30)\r\ntype2 = ticket(70)\r\n\r\nprint(f\"30 歲購買：{type1}\")\r\nprint(f\"70 歲購買：{type2}\")','30 歲購買：成人票\\n\r\n70 歲購買：敬老票','30 歲購買：敬老票\\n\r\n70 歲購買：成人票','30 歲購買：成人票\\n\r\n70 歲購買：兒童票','30 歲購買：敬老票\\n\r\n70 歲購買：兒童票','A','函式會根據輸入年齡 30 和 70 依序判斷，並回傳「成人票」和「敬老票」。','2025-09-02 17:48:26','https://raw.githubusercontent.com/YeChenHua/bot-images/main/images/Q6-3.png','AgACAgQAAxkDAAJGh2jmjn-L43r9C5NNYVsPUv6Tafe8AAJ7uzEbObc8U3EXZP5ha4MTAQADAgADdwADNgQ');
