',1,11,'2025-10-27 18:32:05'),(1584,'8324824508',12,'B',1,10,'2025-10-27 18:32:25'),(1585,'8180312328',12,'B',1,9,'2025-10-27 18:32:28'),(1586,'8324824508',13,'B',1,9,'2025-10-27 18:32:47'),(1587,'8180312328',13,'B',1,10,'2025-10-27 18:32:52'),(1588,'8324824508',14,'A',1,10,'2025-10-27 18:33:10'),(1589,'8180312328',14,'A',1,9,'2025-10-27 18:33:14'),(1590,'8324824508',15,'B',1,10,'2025-10-27 18:33:34'),(1591,'8180312328',15,'B',1,9,'2025-10-27 18:33:37'),(1592,'8000280184',11,'D',1,42,'2025-10-27 20:51:01'),(1593,'8000280184',12,'B',1,32,'2025-10-27 20:51:46'),(1594,'8000280184',13,'B',1,99,'2025-10-27 20:53:37'),(1595,'8000280184',14,'A',1,47,'2025-10-27 20:55:06'),(1596,'8000280184',15,'B',1,35,'2025-10-27 20:55:54'),(1597,'6543903782',11,'D',1,32,'2025-10-30 08:34:48'),(1598,'6543903782',12,'A',0,51,'2025-10-30 08:35:52'),(1599,'6543903782',13,'A',0,47,'2025-10-30 08:37:02'),(1600,'6543903782',14,'A',1,50,'2025-10-30 08:38:14'),(1601,'6543903782',15,'B',1,31,'2025-10-30 08:38:57');
