INSERT INTO `questions` VALUES (1,1,1,'哪一行 Python 程式碼可以把文字內容顯示在螢幕上？',NULL,'print(\"Hello, world\")','echo \"Hello, world\";','printf(\"Hello, world\")','console.log(\"Hello, world\");','A','✅ 正確做法：\r\n- 使用 print() 將文字輸出到畫面\r\n\r\n❌ 常見錯誤：\r\n- 其他函式不是 Python 標準輸出','2025-07-31 02:39:07'),(2,1,2,'哪一行程式碼可以讓使用者輸入內容並存到變數 name？',NULL,'name = get(\"請輸入名字：\")','name = input(\"請輸入名字：\")','name = read(\"請輸入名字：\")','name = scan(\"請輸入名字：\")','B','✅ 正確做法：\r\n- 用 input() 接收使用者輸入並存入變數\r\n\r\n❌ 常見錯誤：\r\n- 其他函式不是 Python 標準輸入','2025-07-31 02:39:07'),(3,1,3,'下列哪一行程式碼可以正確顯示「你好，小明」？','name = \"小明\"','print(\"你好，name\")','print(\"你好，\" + name)','print(你好, name)','print(f\"你好，name\")','B','✅ 正確做法：\r\n- 用字串與變數串接，例如 \"你好，\" + name\r\n\r\n❌ 常見錯誤：\r\n- 變數名稱放在引號內，只會顯示文字\r\n- 用逗號分開文字與變數，會出現格式或語法問題','2025-07-31 02:39:07'),(4,1,4,'下列哪一行程式碼可以正確顯示文字「你點了：3杯珍奶」？','amount = 3','print(f\"你點了：{amount}杯珍奶\")','print(\"你點了：amount杯珍奶\")','print(\"你點了：\" + amount + \"杯珍奶\")','print(\"你點了：{}杯珍奶\".format(amount))','A','✅ 正確做法：\r\n- 用 f-string 或其他正確字串插入方式，把變數值顯示出來\r\n\r\n❌ 常見錯誤：\r\n- 直接把變數名稱放在字串內\r\n- 用 + 串接時類型不符會出錯','2025-07-31 02:39:07'),(5,1,5,'哪一行程式能同時正確顯示品項、份數與總價？','a = input(\"請輸入品項：\")  \r\nb = int(input(\"請輸入數量：\"))  \r\np = 20','print(f\"你點了\" + {a})\r\nprint(f\"共{b}份\")\r\nprint(f\"總價{b*p}元\")','print(\"你點了\" + a)\r\nprint(\"共b份\")\r\nprint(\"總價b*p元\")','print(\"你點了\" + a)\r\nprint(f\"共{p}份\")\r\nprint(f\"總價{b*a}元\")','print(\"你點了\" + a)\r\nprint(f\"共{b}份\")\r\nprint(f\"總價{b*p}元\")','D','✅ 正確：\r\n- f-string 可同時插入變數與運算結果\r\n\r\n❌ 常見錯誤：\r\n- 直接用 + 串接數字會錯誤\r\n- f-string 寫法錯會導致變數沒代入','2025-07-31 02:39:07'),(6,2,1,'整數比較，以下程式碼的執行結果為何？','num = 15\r\nif num % 2 == 0 and num < 10:\r\n    print(\"偶數且小於 10\")\r\nelif num % 2 == 1 and num < 20:\r\n    print(\"奇數且小於 20\")\r\nelse:\r\n    print(\"不符合上述條件\")','偶數且小於 10','奇數且小於 10','不符合上述條件','奇數且小於 20','D','✅ 正確：\r\n- num = 15，為奇數，且小於 20 → 符合 elif 條件 → 輸出「奇數且小於 20」。\r\n\r\n❌ 常見錯誤：\r\n- 以為條件會同時判斷 < 10 與 < 20，忽略了奇偶判斷。\r\n- 搞混 if-elif 的邏輯，以為會同時執行多個區塊。','2025-08-27 22:14:52'),(7,2,2,'以下哪一段程式寫法是正確且能確保條件判斷只會輸出一行結果的？',NULL,'score = 95\r\nif score >= 90:\r\n    print(\"優異\")\r\nif score >= 75:\r\n    print(\"良好\")\r\nelse:\r\n    print(\"需加油\")','score = 95\r\nif score >= 90:\r\n    print(\"優異\")\r\nif score >= 80:\r\n    print(\"良好\")\r\nelif score >= 60:\r\n    print(\"及格\")','score = 95\r\nif score >= 90:\r\n    print(\"優異\")\r\nelif score >= 75:\r\n    print(\"良好\")\r\nelse:\r\n    print(\"需加油\")','score = 95\r\nif score >= 90:\r\n    print(\"優異\")\r\nif score < 60:\r\n    print(\"需加油\")\r\nelse:\r\n    print(\"良好\")','C','✅ 正確：\r\n- 使用 if … elif … else … 結構，條件互斥，保證只會輸出一行。\r\n\r\n❌ 常見錯誤：\r\n- 同時使用多個 if，會在條件重疊時印出兩行。\r\n- 把 else 搭配錯誤的 if，會造成多餘輸出。','2025-08-27 22:14:52'),(8,2,3,'字串大小寫比較，請問以下程式的輸出結果為何？','str1 = \"Python\"\r\nstr2 = \"python\"\r\nif str1 == str2:\r\n    print(\"字串相同\")\r\nelse:\r\n    print(\"字串不同\")','字串不同','字串相同','程式會報錯','不會有任何輸出','A','✅ 正確：\r\n- Python 的字串比較是 區分大小寫 的，\"Python\" 和 \"python\" 不相等，因此進入 else 區塊。\r\n\r\n❌ 常見錯誤：\r\n- 以為字串比較會忽略大小寫，錯誤地判斷為「字串相同」。','2025-08-27 22:14:52'),(9,2,4,'選出正確的寫法：判斷整數 n 是否符合下列條件，若符合印出「符合」，否則印出「不符合」。\r\n條件為：n 為 0，或 n 是偶數且介於 10（含）到 20（不含）。',NULL,'n = int(input())\r\nif (n == 0 or n % 2 == 0) and 10 <= n < 20:\r\n    print(\"符合\")\r\nelse:\r\n    print(\"不符合\")','n = int(input())\r\nif n == 0 or n % 2 == 0 and 10 <= n <= 20:\r\n    print(\"符合\")\r\nelse:\r\n    print(\"不符合\")','n = int(input())\r\nif n == 0 or (n % 2 == 0 and 10 <= n < 20):\r\n    print(\"符合\")\r\nelse:\r\n    print(\"不符合\")','n = int(input())\r\nif n == 0 or n % 2 and 10 <= n < 20:\r\n    print(\"符合\")\r\nelse:\r\n    print(\"不符合\")','C','✅ 正確：\r\n- 用括號明確區分，10 <= n < 20 符合「含 10、不含 20」。\r\n\r\n❌ 常見錯誤：\r\n- 括號放錯、把 20 算進去、直接用 n % 2 當布林。','2025-08-27 22:14:52'),(10,2,5,'執行下列程式，若第一行輸入 8、第二行輸入 3，輸出為何？','a = input()\r\nb = input()\r\n\r\nif a > b:\r\n    print(\"A大於B\")\r\nelif a == b:\r\n    print(\"A等於B\")\r\nelse:\r\n    print(\"A小於B\")','A大於B','A小於B','A等於B','不會有任何輸出','B','✅ 正確：\r\n- input() 回傳字串，字串比較依字典序，\"8\" 小於 \"3\"，所以輸出「A小於B」。\r\n\r\n❌ 常見錯誤：\r\n- 認為 8 > 3 → 「A大於B」\r\n- 以為會自動轉數字比較\r\n- 忽略字串比較的規則','2025-08-27 22:14:52'),(11,3,1,'從 1 到 10 的整數中，計算所有偶數的總和為多少？','total = 0\r\nfor i in range(1, 11):\r\n    if i % 2 == 0:\r\n        total += i\r\nprint(total)','25','20','15','30','D','✅ 正確：\r\n- 偶數為 2+4+6+8+10 = 30。\r\n\r\n❌ 常見錯誤：\r\n- 很多人只加到 8 得到 20，或誤算成 25。','2025-08-29 18:40:19'),(12,3,2,'下列程式輸出為何？','for i in range(5):\r\n    if i == 2:\r\n        break\r\nelse:\r\n    print(\"結束\")\r\nprint(\"完成\")','結束\r\n完成','完成','結束','沒有輸出','B','✅ 正確：\r\n- 當迴圈因 break 結束，else 不會執行 → 只會輸出「完成」。\r\n\r\n❌ 常見錯誤：\r\n- 以為一定會跑到 else 印出「結束」。','2025-08-29 18:40:19'),(13,3,3,'執行後輸出為何？','total = 0\r\nfor i in range(1, 4):\r\n    total = 0\r\n    total += i\r\nprint(total)','6','3','0','1','B','✅ 正確：\r\n- 每次迴圈都把 total 重設為 0，再加上 i，最後一次 i=3 → total=3。\r\n\r\n❌ 常見錯誤：\r\n- 以為是 1+2+3=6（忽略重設）\r\n- 以為 print 在迴圈內或縮排一樣。','2025-08-29 18:40:19'),(14,3,4,'下列程式會印出幾次「OK」？','for i in range(5):\r\n    if i % 2 == 0:\r\n        continue\r\n    for j in range(3):\r\n        if j == 1:\r\n            break\r\n        print(\"OK\")','2','3','4','5','A','✅ 正確：\r\n- i 為奇數時（1、3）才會進入內層；內層在 j==1 先 break，因此每次只印一次 → 共 2 次。\r\n\r\n❌ 常見錯誤：\r\n- 以為內層會印 j=0,1 → 2 次（忽略 j==1 先 break）\r\n- 以為 i 走 5 次都會印、或忘了 continue 直接略過偶數。','2025-08-29 18:40:19'),(15,3,5,'下列程式輸出的最後結果為？','x = 0\r\nwhile x < 3:\r\n    x += 1\r\nprint(x)','2','3','4','0','B','✅ 正確：\r\n- x=0 開始，每輪加 1，直到 4 停止 → 最後為 3。\r\n\r\n❌ 常見錯誤：\r\n- 忘記 while 先檢查條件。','2025-08-29 18:40:19'),(16,5,1,'員工名單中，「王志明」的位置是多少？','employees = [\"林小雅\", \"王志明\", \"陳佳欣\", \"張力行\", \"王志明\"]\r\nnew = \"王志明\"\r\nposition = -1\r\n\r\nfor i in range(len(employees)):\r\n    if employees[i] == new:\r\n        position = i\r\n        break\r\n\r\nprint(f\"新進員工 \'{new}\' 的位置是第 {position + 1} 位。\")','新進員工 \'王志明\' 的位置是第 -1 位。','新進員工 \'王志明\' 的位置是第 5 位。','新進員工 \'王志明\' 的位置是第 0 位。','新進員工 \'王志明\' 的位置是第 2 位。','D','迴圈從頭開始尋找第一個符合的 王志明，當找到時立刻用 break 結束，因此只會找到第一個出現的位置（索引 1），最終印出第 2 位。','2025-08-29 18:55:47'),(17,5,2,'同一位客戶的訂單被重複記錄了數次，需要將所有重複的項目都刪除。','orders = [\"筆記本\", \"滑鼠\", \"鍵盤\", \"筆記本\", \"滑鼠\", \"滑鼠\"]\r\nremove = \"滑鼠\"\r\n\r\nwhile remove in orders:\r\n    orders.remove(remove)\r\n\r\nprint(orders)','[\'筆記本\', \'鍵盤\', \'筆記本\']','[\'筆記本\', \'鍵盤\']','[\'筆記本\', \'鍵盤\', \'筆記本\', \'滑鼠\']','[\'筆記本\', \'滑鼠\', \'鍵盤\', \'筆記本\', \'滑鼠\', \'滑鼠\']','A','while 迴圈會持續執行，只要串列中還包含 滑鼠，就用 remove() 函式將其移除，直到所有 滑鼠 都被刪除為止。','2025-08-29 18:55:47'),(18,5,3,'將兩份不同的水果清單合併成一份完整的清單，並且按照字母順序排列。','list1 = [\"apple\", \"banana\", \"kiwi\"]\r\nlist2 = [\"grape\", \"guava\"]\r\ncombined_list = list1 + list2\r\n\r\nsorted_list = sorted(combined_list)\r\n\r\nprint(sorted_list)','[\'apple\', \'banana\', \'kiwi\', \'grape\', \'guava\']','[\'banana\', \'guava\', \'grape\', \'kiwi\', \'apple\']','[\'apple\', \'banana\', \'grape\', \'guava\', \'kiwi\']','[\'guava\', \'grape\', \'kiwi\', \'banana\', \'apple\']','C','list1 + list2 會先將兩個串列合併成一個新串列，然後 sorted() 函式會對這個新串列進行字母排序，並回傳一個已排序的新串列。','2025-08-29 18:55:47'),(19,5,4,'分析一個大型數據集，但只需要取出清單中從第三個元素到第五個元素之間的資料進行分析，最終內容是什麼？','data = [10, 25, 40, 55, 70, 85, 100]\r\nsubset = data[2:5]\r\n\r\nprint(subset)','[10, 25, 40, 55, 70]','[40, 55, 70]','[25, 40, 55]','[25, 40, 55, 70]','B','切片 [2:5] 代表從索引 2 的位置開始取值，一直到索引 5 之前（不包含索引 5），所以會取得索引 2、3、4 的元素。','2025-08-29 18:55:47'),(20,5,5,'在學校的運動會中，需要從選手的得分中找出第二高的分數，以便頒發銀牌。','scores = [95, 80, 85, 95, 90, 80]\r\nscores = sorted(list(set(scores)), reverse=True)\r\nsecond = scores[1]\r\n\r\nprint(f\"第二高的分數是：{second}\")','第二高的分數是：95','第二高的分數是：90','第二高的分數是：85','第二高的分數是：80','B','set() 函式會先移除重複分數，sorted() 函式會將剩下的獨特分數由大到小排序，然後再透過索引 [1] 取得排序後的第二個元素，也就是第二高的分數。','2025-08-29 18:55:47'),(21,6,1,'分析一份包含多個國家城市溫度、濕度的數據，請問程式碼最終內容為何？','weather = {\r\n    \"台北\": {\"t\": 32, \"h\": 75},\r\n    \"東京\": {\"t\": 28, \"h\": 65},\r\n    \"曼谷\": {\"t\": 35, \"h\": 60},\r\n    \"倫敦\": {\"t\": 22, \"h\": 80},\r\n    \"雪梨\": {\"t\": 31, \"h\": 68}\r\n}\r\n\r\ntemp = {}\r\nfor city, area in weather.items():\r\n    if area[\"t\"] > 30 and area[\"h\"] < 70:\r\n        temp[city] = area\r\n        print(f\"{city}: 氣溫 {area[\'t\']}°C，濕度 {area[\'h\']}%\")','曼谷: 氣溫 35°C，濕度 60%','台北: 氣溫 32°C，濕度 75%\r\n曼谷: 氣溫 35°C，濕度 60%','曼谷: 氣溫 35°C，濕度 60%\r\n雪梨: 氣溫 31°C，濕度 68%','東京: 氣溫 28°C，濕度 65%\r\n雪梨: 氣溫 31°C，濕度 68%','C','程式碼會遍歷所有城市，只將同時符合氣溫和濕度條件的城市，列出它們。','2025-09-02 19:57:41'),(22,6,2,'透過學號尋找學生的姓名。請問程式碼最終輸出是什麼？','d = {\r\n    \'李子維\': \'A001\',\r\n    \'黃雨萱\': \'B002\',\r\n    \'莫俊傑\': \'C003\',\r\n    \'陳韻如\': \'D004\'\r\n}\r\nid = \'A001\'\r\nfound = None\r\n\r\nfor name, student in d.items():\r\n    if student == id:\r\n        found = name\r\n        break\r\nprint(found)','A001','None','黃雨萱','李子維','D','程式碼會遍歷每個學生的鍵和值，並透過檢查值是否與目標學號相符，來找到對應的學生姓名。','2025-09-02 20:02:12'),(23,6,3,'從一句話中移除重複的字詞，並將剩下的字詞重新組合成一個字串。','s = \"今天 的 天氣 很好 的 很 適合 出去 玩\"\r\nwords = s.split(\" \")\r\n\r\nseen = set()\r\nresult = []\r\n\r\nfor word in words:\r\n    if word not in seen:\r\n        seen.add(word)\r\n        result.append(word)\r\n\r\nprint(\"\".join(result))\r\n','今天的天氣很好很適合出去玩','今天的很好很適合出去玩','今天天氣很好的很適合出去玩','今天的天氣很好很適合玩','A','這段程式碼會將原始字串中的每個單詞以空格分隔，然後遍歷這些單詞，只將第一次出現的單詞保留下來，最後再將所有保留的單詞無縫接合成一個新的字串。','2025-09-02 20:16:49'),(24,6,4,'更新一個產品在特定供應商的庫存數量。最終輸出結果是什麼？','products = {\r\n    \"A101\": {\r\n        \"name\": \"手機\",\r\n        \"stock\": {\"a\": 50, \"b\": 20}\r\n    },\r\n    \"B202\": {\r\n        \"name\": \"筆電\",\r\n        \"stock\": {\"a\": 10, \"b\": 35}\r\n    }\r\n}\r\n\r\nproducts[\"A101\"][\"stock\"][\"b\"] = 10\r\n\r\nprint(products[\"A101\"][\"stock\"])','{\'a\': 50, \'b\': 20}','{\'a\': 50, \'b\': 10}','{\'a\': 10, \'b\': 35}','{\'a\': 10, \'b\': 10}','B','程式碼透過多層次的鍵存取，直接定位到stock字典裡的b，並將其數值從 20 更新為 10。','2025-09-02 20:22:07'),(25,6,5,'從產品銷售額列表中，找出銷售額最高的產品。','sales = {\r\n    \"手機\": 150000,\r\n    \"筆電\": 250000,\r\n    \"平板\": 90000,\r\n    \"耳機\": 50000\r\n}\r\n\r\nmax = max(sales, key=sales.get)\r\n\r\nprint(max)','150000','筆電','手機','250000','B','max() 函式搭配 key=sales.get 參數，讓程式可以根據每個鍵所對應的值來找到字典中數值最大所屬的鍵。','2025-09-02 20:25:14'),(26,4,1,'計算每位員工的銷售獎金，獎金規則是：銷售額超過 1000 元的員工，其獎金為超額部分的 10%；若未達標則沒有獎金。','def calculate(data):\r\n    result = {}\r\n    for name, sales in data.items():\r\n        if sales > 1000:\r\n            b = int((sales - 1000) * 0.1)\r\n            result[name] = b\r\n        else:\r\n            result[name] = 0\r\n    return result\r\n\r\nemployee = {\"小明\": 1200, \"小華\": 950, \"小美\": 1500}\r\nbonus = calculate(employee)\r\nprint(bonus)','{\'小明\': 120, \'小華\': 95, \'小美\': 150}','{\'小明\': 20.0, \'小華\': 0, \'小美\': 50.0}','{\'小明\': 20, \'小華\': 0, \'小美\': 50, \'小強\': 0}','{\'小明\': 20, \'小華\': 0, \'小美\': 50}','D','函式遍歷員工資料，透過 if...else 判斷銷售額是否超過 1000，動態計算獎金並回傳新的獎金字典。由於使用 int()，獎金結果只保留整數。','2025-09-02 21:40:14'),(27,4,2,'以下是一份學生考試成績單，每個學生有多個科目成績，需要計算出每個學生有多少科目是及格的（60 分以上）。','def passing(grades):\r\n    counts = {}\r\n    for student, scores in grades.items():\r\n        count = 0\r\n        for score in scores:\r\n            if score >= 60:\r\n                count += 1\r\n        counts[student] = count\r\n    return counts\r\n\r\ngrades = {\r\n    \"天天\": [85, 70, 55],\r\n    \"小小\": [90, 80, 75],\r\n    \"尤尤\": [50, 65, 40]\r\n}\r\nresults = passing(grades)\r\nprint(results)','{\'天天\': 3, \'小小\': 3, \'尤尤\': 3}','{\'天天\': [85, 70], \'小小\': [90, 80, 75], \'尤尤\': [65]}','{\'天天\': 2, \'小小\': 3, \'尤尤\': 1}','{\'天天\': 2, \'小小\': 3, \'尤尤\': 2}','C','函式使用雙層迴圈，外層遍歷學生，內層遍歷成績，並使用一個計數器來統計每個學生有多少科目及格。','2025-09-02 21:47:31'),(28,4,3,'兩份不同的數據清單：一個是產品名稱串列，另一個是產品價格串列，將它們合併成一個字典，並為所有價格加上 10% 的稅金。','def apply(names, costs):\r\n    result = {}\r\n    for n, c in zip(names, costs):\r\n        result[n] = int(c * 1.1)\r\n    return result\r\n\r\nnames = [\"手機\", \"筆電\", \"平板\"]\r\ncosts = [1000, 2000, 500]\r\nfinal = apply(names, costs)\r\nprint(\", \".join(f\"{n}: {p}\" for n, p in final.items()))','手機: 1100, 筆電: 2200, 平板: 550','手機: 1100.0, 筆電: 2200.0, 平板: 550.0','{\'手機\': 1100, \'筆電\': 2200, \'平板\': 550}','{\'手機\': 1100.0, \'筆電\': 2200.0, \'平板\': 550.0}','A','zip() 函式將兩個串列合併，int() 函式將計算結果的小數部分捨去，只保留整數。最後，.join() 方法將字典中的鍵值對格式化成字串並以逗號分隔，因此沒有大括號。','2025-09-02 21:55:43'),(29,4,4,'計算一個數字的階乘，如果輸入的數字為負數，則回傳錯誤訊息。','def f(n):\r\n    if n < 0:\r\n        return \"錯誤：階乘無法處理負數。\"\r\n    if n == 0:\r\n        return 1\r\n    else:\r\n        return n * f(n - 1)\r\n\r\nn = 5\r\nresult = f(n)\r\nprint(f\"{n} 的階乘是：{result}\")','5的階乘是：20','5 的階乘是：120','5 的階乘是：-120','5 的階乘是：100','B','函式在進行遞迴前，會先檢查輸入的數值是否為負數。如果是，它會直接回傳一個錯誤訊息字串，並終止函式執行，避免了因為負數而導致的遞迴問題。','2025-09-02 22:00:30'),(30,4,5,'將一串產品的銷售記錄，轉換為每個產品類別的總銷售量。','def ss(records):\r\n    summary = {}\r\n    for r in records:\r\n        cat = r[\"category\"]\r\n        qty = r[\"quantity\"]\r\n        summary[cat] = summary.get(cat, 0) + qty\r\n    return summary\r\n\r\nsales = [\r\n    {\"category\": \"電子產品\", \"quantity\": 10},\r\n    {\"category\": \"服飾\", \"quantity\": 5},\r\n    {\"category\": \"電子產品\", \"quantity\": 15},\r\n    {\"category\": \"居家用品\", \"quantity\": 8},\r\n    {\"category\": \"服飾\", \"quantity\": 12}\r\n]\r\n\r\nsales_summary = ss(sales)\r\nprint(sales_summary)','{\'電子產品\': 10, \'服飾\': 5, \'居家用品\': 8}','{\'電子產品\': 25, \'服飾\': 17, \'居家用品\': 8}','{\'電子產品\': 15, \'服飾\': 12, \'居家用品\': 8}','{\'category\': \'電子產品\', \'quantity\': 10}','B','函式遍歷銷售記錄串列，並利用 get() 方法動態累加每個產品類別的銷售量，從而將散亂的記錄整理成總計。','2025-09-02 22:10:41');
