CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `username` varchar(50) NOT NULL COMMENT '學號',
  `full_name` varchar(100) DEFAULT NULL COMMENT '姓名',
  `telegram_id` varchar(64) DEFAULT NULL,
  `role` enum('student','admin') NOT NULL DEFAULT 'student',
  `class_code` enum('A','B') DEFAULT NULL COMMENT '兩個班，用 A(夜)/B(日)；班外測試者可為 NULL',
  `is_tester` tinyint(1) NOT NULL DEFAULT 0 COMMENT '1=班外測試者/特例',
  `status` enum('active','disabled') NOT NULL DEFAULT 'active',
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `bind_at` timestamp NULL DEFAULT NULL COMMENT '完成綁定的時間（可選）',
  `state` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uniq_username` (`username`),
  UNIQUE KEY `uniq_telegram_id` (`telegram_id`)
) ENGINE=InnoDB AUTO_INCREMENT=390 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
